const mongoose = require('mongoose')
// https://www.base64-image.de/     to set default image 

const employeeSchema = new mongoose.Schema ({
   
    employeeNo :{ type :String, required :true },
    empName  :{ type :String , required : [true, 'Employee name is required'] },
    contactNo : { type: String, required : [true , 'Contact number is required'] },
    address :{ type: String , required :[true , 'Address is required ']},

    email :{ type: String , required :[ true, 'Email is required'] },
    password : { type : String } ,
    department :{ type: String, required : [true ,'Depart ment is required ']},
    empJob :{ type :String , required : [true, 'Job is required']},
    empSalary :{ type :Number, default :0 },
    jobNo :{ type : String, required :[true, 'jobNo is required ']},
    jobDate :{ type : Date, required :[true, 'jobDate is required ']},


    image :{ type: String, default :"data:image/jpeg;base64," },
    
    user: { type: mongoose.Schema.Types.ObjectId, ref: "User" },

}, {timestamps :true});



module.exports = mongoose.model('Employee', employeeSchema);